class Solution(object):
    def maxNumber(self, nums1, nums2, k):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[int]
        """

        def pick_max(nums, k):
            ans = []
            for i in range(len(nums)):
                if len(ans) < k:
                    ans.append(nums[i])
                else:
                    if nums[i] > ans[-1]:
                        ans.pop()
                        ans.append(nums[i])
            return ans

        def merge(nums1, nums2):
            ans = []
            i, j = 0, 0
            while i < len(nums1) and j < len(nums2):
                if nums1[i] > nums2[j]:
                    ans.append(nums1[i])
                    i += 1
                else:
                    ans.append(nums2[j])
                    j += 1
            ans += nums1[i:]
            ans += nums2[j:]
            return ans

        def find_max(nums, k):
            ans = []
            for i in range(len(nums)):
                if len(ans) < k:
                    ans.append(nums[i])
                else:
                    if nums[i] > ans[-1]:
                        ans.pop()
                        ans.append(nums[i])
            return ans

        m, n = len(nums1), len(nums2)
        if m + n < k:
            return []
        if m < k:
            return nums2
        if n < k:
            return nums1
        if m == n == k:
            return merge(nums1, nums2)
        if m < n:
            return merge(pick_max(nums1, k), pick_max(nums2, k))
        else:
            return merge(pick_max(nums2, k), pick_max(nums1, k))

