class Solution(object):
    def totalNQueens(self, n):
        """
        :type n: int
        :rtype: int
        """

        def isValid(board, row, col):
            for i in range(row):
                if board[i][col] == 'Q':
                    return False
            i = row - 1
            j = col - 1
            while i >= 0 and j >= 0:
                if board[i][j] == 'Q':
                    return False
                i -= 1
                j -= 1
            i = row - 1
            j = col + 1
            while i >= 0 and j < n:
                if board[i][j] == 'Q':
                    return False
                i -= 1
                j += 1
            return True

        def backtrack(board, row):
            if row == n:
                self.count += 1
                return
            for col in range(n):
                if isValid(board, row, col):
                    board[row][col] = 'Q'
                    backtrack(board, row + 1)
                    board[row][col] = '.'

        self.count = 0
        board = [['.' for _ in range(n)] for _ in range(n)]
        backtrack(board, 0)
        return self.count

